    "lyrics": "All green things growing under every sky,<br>All hands reaching into grave,<br>Every horse's chest drums out the sound, the<br>Beating beating of hearts, feet and fists,<br>On the ground, on the ground, on your body;<br>On your body, on your skin,<br>And every building falls and flowers grow;<br>And seabirds cry the sounds<br>Of Now and Here and Salt and Fear and Open;<br>And the eyes of the fox are open, and the eyes<br>Of the rabbit are open, and the grass<br>Will never stop, and the sun<br>Rolls down your mountain bones, leaving<br>Scorched grass,<br>And a lamb, eyes closed and stiff and cold,<br>In your arms so heavy;<br>Soft soft its skull and gold and dull,<br>We wait for rain.\nWhat sphinx of cement and aluminum bashed open their skulls and ate up their brains and imagination?<br>Moloch! Solitude! Filth! Ugliness! Ashcans and unobtainable dollars! Children screaming under the stairways! Boys sobbing in armies! Old men weeping in the parks!<br>Moloch! Moloch! Nightmare of Moloch! Moloch the loveless! Mental Moloch! Moloch the heavy judger of men!<br>Moloch the incomprehensible prison! Moloch the crossbone soulless jailhouse and Congress of sorrows! Moloch whose buildings are judgment! Moloch the vast stone of war! Moloch the stunned governments!<br>Moloch whose mind is pure machinery! Moloch whose blood is running money! Moloch whose fingers are ten armies! Moloch whose breast is a cannibal dynamo! Moloch whose ear is a smoking tomb!<br>Moloch whose eyes are a thousand blind windows! Moloch whose skyscrapers stand in the long streets like endless Jehovahs! Moloch whose factories dream and croak in the fog! Moloch whose smoke-stacks and antennae crown the cities!<br>Moloch whose love is endless oil and stone! Moloch whose soul is electricity and banks! Moloch whose poverty is the specter of genius! Moloch whose fate is a cloud of sexless hydrogen! Moloch whose name is the Mind!<br>Moloch in whom I sit lonely! Moloch in whom I dream Angels! Crazy in Moloch! Cocksucker in Moloch! Lacklove and manless in Moloch!<br>Moloch who entered my soul early! Moloch in whom I am a consciousness without a body! Moloch who frightened me out of my natural ecstasy! Moloch whom I abandon! Wake up in Moloch! Light streaming out of the sky!<br>Moloch! Moloch! Robot apartments! invisible suburbs! skeleton treasuries! blind capitals! demonic industries! spectral nations! invincible madhouses! granite cocks! monstrous bombs!<br>They broke their backs lifting Moloch to Heaven! Pavements, trees, radios, tons! lifting the city to Heaven which exists and is everywhere about us!<br>Visions! omens! hallucinations! miracles! ecstasies! gone down the American river!<br>Dreams! adorations! illuminations! religions! the whole boatload of sensitive bullshit!<br>Breakthroughs! over the river! flips and crucifixions! gone down the flood! Highs! Epiphanies! Despairs! Ten years‚Äô animal screams and suicides! Minds! New loves! Mad generation! down on the rocks of Time!<br>Real holy laughter in the river! They saw it all! the wild eyes! the holy yells! They bade farewell! They jumped off the roof! to solitude! waving! carrying flowers! Down to the river! into the street!",
